  \"Reduction of Flight Control System/Structural Mode Interaction Project\",\n\t\"tracking_summary\":
  {\n\t\t\"total\": 6,\n\t\t\"recent\": 0\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2015-05-07T06:03:16.739503\",\n\t\"name\": \"reduction-of-flight-control-system-structural-mode-interaction-project\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"A novel approach is proposed for reducing
  the degree of interaction of a high gain flight control system with the airframe
  structural vibration modes, representing a complete departure from the traditional
  approach of using notch filters.  In principle it offers similar or better performance
  than notch filters, while not suffering from the attendant low frequency phase lag
  that has an adverse effect on pilot handling qualities.  Structural mode interaction
  can be a significant problem in high performance aircraft and other aircraft with
  low frequency vibration modes.  Use of notch filters requires a compromise to be
  reached between airframe structural stability and handling qualities.  Successful
  application of the proposed method will relieve the flight control system designer
  of the need for managing this compromise and will allow the achievement of full
  potential system performance with better handling qualities.  Basic feasibility
  has already been established and Phase I will broadened this to cover practical
  implementation issues and to define test evaluation plans.  Phase II will extend
  the method into actual test evaluation, either by laboratory test or flight test,
  or both.  Other possible applications such as aircraft active control systems and
  control of space structures will be considered during the research program.\",\n\t\"license_title\":
